window.bookSummaryJSON = "<p>Clans are unity. No variation. No deviation. </p> <p>On Clades, to be a Clan is to be an exact copy. A perfect society cloning themselves to survive, even as the zombielike Frags threaten to overrun them on an unforgiving planet. </p> <p>Clan 1672 (privately known as Twain) was never supposed to survive the Incubation Tank. But he did. Illegally. He is different from the other Clans. </p> <p>He has a secret that could destroy him. </p>"; 
